function Navbar() {
  return (
    <nav className="navbar">
      <h2>SmileCare</h2>
      <div>
        <a href="#home">Home</a>
        <a href="#services">Services</a>
        <a href="#appointment">Appointment</a>
        <a href="#timings">Timings</a>
        <a href="#location">Location</a>
      </div>
    </nav>
  );
}

export default Navbar;
